import { Component } from '@angular/core';
import { ApiService } from './service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
  newdata: any;
  constructor(private _apiService: ApiService) { }

  ngOnInit() {
    this._apiService.getData().subscribe(res => {
      this.newdata = res;
    })
  }
}
